def solve():
    parts = stabilizers_data.replace('\n', ' ').split(',')
    stabilizers = [p.strip() for p in parts if p.strip()]
    pauli_strings = [stim.PauliString(s) for s in stabilizers]
    
    # Simple greedy approach: keep if commutes with all previously kept
    kept = []
    discarded = []
    
    for i, p in enumerate(pauli_strings):
        commutes = True
        for k in kept:
            if not p.commutes(k):
                commutes = False
                break
        if commutes:
            kept.append(p)
        else:
            discarded.append(i)
            
    print(f"Total stabilizers: {len(stabilizers)}")
    print(f"Kept: {len(kept)}")
    print(f"Discarded: {len(discarded)}")
    
    try:
        tableau = stim.Tableau.from_stabilizers(kept, allow_underconstrained=True, allow_redundant=True)
        circuit = tableau.to_circuit("elimination")
        
        with open('circuit_161.stim', 'w') as f:
            f.write(str(circuit))
            
        print("Circuit generated and saved to circuit_161.stim")
        
    except Exception as e:
        print(f"Error: {e}")

if __name__ == "__main__":
    solve()
